The labels in the task pool are currently incorrectly assigned. Please see the image which shows many of the task pool records as "reviewed" and many of these are not yet in the review stage. Only the records with the metadata for "version" have been reviewed. I'm available to Zoom if you would like a walk-thru for what we are experiencing.
